import { Menu } from '@mui/icons-material';
import { Drawer, Icon, IconButton, List, ListItemButton, ListItemIcon, ListItemText, Typography } from '@mui/material'
import React, { useState } from 'react'

const Sidemenu = () => {
    const[openside,setOpenside]=useState(false);

  return (
    <React.Fragment>
        <Drawer open={openside}>
         <div>
            Test
         </div>

        </Drawer>
        <IconButton onClick={()=>setOpenside(!openside)}></IconButton>

    </React.Fragment>
  )
}

export default Sidemenu
